import React from 'react';


function App() {
  return (
    <div className="App">
      <div className="header">
        <p>Podcast Ideas</p>
      </div>
      <div className="content">
        <div className="square"></div>
      </div>
      <div className="footer">Hello</div>


    </div>
  );
}

export default App;
